Let's think step by step about modeling responder behavior in this economic game.

**Key Psychological Mechanisms:**

1. **Fairness:** Responders likely consider whether the proposed split is fair relative to their contribution (token_self) and the opponent's contribution (token_opp).  A perceived unfair split will lead to rejection.

2. **Self-Interest:**  The absolute amount of money offered (split_self) is a primary driver. A higher offer is more likely to be accepted, regardless of fairness considerations.

3. **Risk Aversion:**  Responders might be averse to the risk of receiving nothing (rejecting the offer) versus accepting a smaller but guaranteed amount.  This influence is likely to be more pronounced with lower combined earnings.

4. **Trial Type:** The type of trial (trial_type) – equal, opponent more, participant more – might subtly influence the perception of fairness, even when controlling for the absolute split and contributions.

**How Mechanisms Interact:**

Fairness and self-interest are likely to interact. A highly unfair offer might be accepted if the absolute amount is sufficiently high, and vice-versa; a very fair offer might be rejected if the absolute amount is very low. Risk aversion will modulate the strength of this interaction, with greater aversion amplifying the impact of the absolute amount. Trial type subtly modifies the perceived fairness.

**Mathematical Form:**

A logistic regression model can capture these interactions effectively, allowing for binary prediction (accept/reject). We will use a weighted combination of fairness, self-interest, and risk aversion to predict utility:

**Parameters:**

We need parameters to weight the influence of fairness, self-interest, risk aversion, and the subtle effect of trial type.  These will be learnable parameters.

**Mapping to Observable Behavior:**

The model's output (utility) is passed through a logistic function to predict the probability of acceptance. The model variables directly correspond to features in the dataset.


